import { findDocuments, insertDocument } from '../mongoAPI'

const collectionName = 'note'

export class Note {
  _id: string
  text: string

  constructor(text: string) {
    this.text = text
  }

  insert(): void {
    insertDocument(collectionName, this)
  }
  static find(id?: string): Note[] {
    return findDocuments(collectionName, id ? { _id: id } : {}) as Note[]
  }
}
